	public function __construct($version, $username){
		$this->username = $username;
		$this->version = $version;
	}

	public function checkDBUser($data){
		global $db;
		$query = $db->query("SELECT `last_updated` FROM `".$this->version."` WHERE `player_name` ='".$this->username."'") or die ($db->error);
		if($query->num_rows != 0){
			$out = $this->queryDBOld();
			if(isset($_GET['update']) && $_GET['update'] == "1"){
				$lastUpdated = $query->fetch_row();
				$this->updateInfo($lastUpdated,$data);
			}
			return $out;
		}
		else{
			$this->insertUser($data);
		}
	}
	private function updateInfo($lastUpdated, $data){
		global $db;
		$sql = "UPDATE `".$this->version."` SET `data` ='".$data."', ";
		if(($lastUpdated[0]+60*60*24*7) < time()){
			$sql .= "`7day` ='".$data."', ";
		}
		if(($lastUpdated[0]+60*60*24*30) < time()){
			$sql .= "`30day` ='".$data."', ";
		}
		$sql .= "`last_updated` ='".time()."' WHERE `player_name` = '".$this->username."'";
		$db->query($sql) or die ($db->error);
	}

	private function insertUser($data){
		global $db;
		$db->query("INSERT INTO `".$this->version."` (`player_name` ,`data` ,`last_updated`, `7day`, `30day`) VALUES ('".$this->username."', '".$data."', '".time()."', '".$data."', '".$data."')") or die ($db->error);
	}

	private function queryDBOld(){
		global $db;
		$query = $db->query("SELECT * FROM `".$this->version."` WHERE `player_name` ='".$this->username."'") or die ($db->error);
		return $query->fetch_array(MYSQLI_ASSOC);
	}

	public function queryHiScores(){
		$get_page_info = curl_init('http://services.runescape.com/m=hiscore'.($this->version == "old" ? '_oldschool' : '').'/index_lite.ws?player='.$this->username);
		$options = array(CURLOPT_RETURNTRANSFER => TRUE, CURLOPT_BINARYTRANSFER => TRUE);
		curl_setopt_array($get_page_info, $options);
		$page_info = curl_exec($get_page_info);
		$curl_info = curl_getinfo($get_page_info);
		if($curl_info['http_code'] == 200){
			curl_close($get_page_info);
			return $page_info;
		}
	}

	private function compare($new, $old){
		$i = 0;
		foreach($new as $parsedNew){
			$parsedNew = explode(",", $parsedNew); //[0][1]([2])
			$parsedOld = explode(",", $old[$i]); //[0][1]([2])
			$j = 0;

			foreach($parsedNew as $checkDiffernce){
				$difference = $checkDiffernce - $parsedOld[$j];
				if($checkDiffernce == '-1'){//isn't ranked
					$formatDifference[$i][] = $checkDiffernce;
				}
				else if($difference == 0){//no difference
					$formatDifference[$i][] = '<td class="">&plusmn;0</td>';
				}
				else if($difference > 0){//don't worry this confuses me but it's needed because levels going up is a good thing, this should be notated as down otherwise
					if($j == 0)
						$formatDifference[$i][] = '<td class="danger">-'.number_format(abs($difference)).'</td>';
					else
						$formatDifference[$i][] = '<td class="success">+'.number_format(abs($difference)).'</td>';
				}
				else if($difference < 0){//up
					$formatDifference[$i][] = '<td class="success">+'.number_format(abs($difference)).'</td>';
				}
				$j++;
			}
			$i++;
		}
		return $formatDifference;
	}
	
	private function explodeNew($new){
		$i = 0;
		foreach($new as $parsedNew){
			$parsedNew = explode(",", $parsedNew); //[0][1]([2])
			foreach($parsedNew as $output){
					$formatDifference[$i][] = $output;
			}
			$i++;
		}
		return $formatDifference;
	}

	public function outputSkills($old,$new){
		$newData = $this->explodeNew($new);
		$data = $this->compare($old, $new);
		$skills = array_slice($data, 0, ($this->version == "old" ? 24 : 28), true);
		$newSkills = array_slice($newData, 0, ($this->version == "old" ? 24 : 28), true);
		$out = '<table class="table table-hover table-bordered table-condensed"><thead><tr><th>Skills</th><th colspan="2">Rank</th><th colspan="2">Level</th><th colspan="2">EXP</th></tr></thead><tbody>';
		$i = 0;

		foreach($skills as $parsed){
			if($parsed[0] == '-1'){
				$out .= '<tr><th scope="row"><img src="'.$this->skillImageLinks[$i].'"/> '.($this->version == "old" ? $this->skillNamesOld[$i] : $this->skillNamesNew[$i]).'</th><td class="info" colspan="7">Not Ranked</td></tr>';
				$i++;
				continue;
			}
			$out .= '
					<tr>
						<th scope="row"><img src="'.$this->skillImageLinks[$i].'"/> '.($this->version == "old" ? $this->skillNamesOld[$i] : $this->skillNamesNew[$i]).'</th>
						<td>'.number_format($newSkills[($i)][0]).'</td>
						'.$parsed[0].'
						<td>'.number_format($newSkills[($i)][1]).'</td>
						'.$parsed[1].'
						<td>'.number_format($newSkills[($i)][2]).'</td>
						'.$parsed[2].'
					</tr>';
			
			$i++;
		}

		$out .= '</table>';
		return $out;
	}

	public function outputMiniGames($old,$new){
		$newData = $this->explodeNew($new);
		$data = $this->compare($old, $new);
		$minigames = ($this->version == "old" ? array_slice($data, 24, 3, true) : array_slice($data, 28, 13, true));
		$newMiniGames = ($this->version == "old" ? array_slice($newData, 24, 3, true) : array_slice($newData, 28, 13, true));
		$out = '<table class="table table-hover table-bordered table-condensed"><thead><tr><th>Game</th><th colspan="2">Rank</th><th colspan="2">Score</th></tr></thead><tbody>';
		$i = 0;

		foreach ($minigames as $parsed){
			if($parsed[0] == '-1'){
				$out .= '<tr><th scope="row"><img src="'.($this->version == "old" ? $this->miniImagesLinksOld[$i] : $this->miniImagesLinksNew[$i]).'"/> '.($this->version == "old" ? $this->miniNamesOld[$i] : $this->miniNamesNew[$i]).'</th><td class="info" colspan="4">Not Ranked</td></tr>';
				$i++;
				continue;
			}
			$out .= '
					<tr>
						<th scope="row"><img src="'.($this->version == "old" ? $this->miniImagesLinksOld[$i] : $this->miniImagesLinksNew[$i]).'"/> '.($this->version == "old" ? $this->miniNamesOld[$i] : $this->miniNamesNew[$i]).'</th>
						<td>'.number_format($newMiniGames[($i+($this->version == "old" ? 24 : 28))][0]).'</td>
						'.$parsed[0].'
						<td>'.number_format($newMiniGames[($i+($this->version == "old" ? 24 : 28))][1]).'</td>
						'.$parsed[1].'
					</tr>';
			$i++;
		}

		$out .= '</tbody></table>';
		return $out;
	}
}

